import React from 'react';

const User = ({ name, username, email }) => {
    return(
        <div style= {{margin: '5px', pading: '5px', width: '200px', height: 'auto', display: 'inline-block', textAlign: 'center', backgrondColor: 'white', border: '1px solid black'}}>
            <h1>Name: {name}</h1>
            <h2>Username: {username}</h2>
            <p>Email: {email}</p>
        </div>
    );
}

export default User;
